import React from "react";
import { connect } from "react-redux";
import { compose } from "redux";
import { firestoreConnect } from "react-redux-firebase";

const DriverProfileList = props => {
  const { driver } = props;
  return (
    <div>
      <div>Hello {driver.title}</div>
      <div>Posted by {driver.authorFirstName}</div>
      <div>Posted by {driver.authorLastName}</div>
    </div>
  );
};

const mapStateToProps = (state, ownProps) => {
  // console.log(state);
  const id = ownProps.match.params.id;
  const drivers = state.firestore.data.drivers;
  const driver = drivers ? drivers[id] : null;
  return {
    driver: driver
  };
};

export default compose(
  connect(mapStateToProps),
  firestoreConnect([{ collection: "drivers" }])
)(DriverProfileList);
